import { useState } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import CountrySearchForm from "app/components/CountrySearchForm";
import CountryList from "app/components/CountryList";
import Navbar from "app/components/Navbar";
import { Routes } from "./utils/enums/routes";

export interface CountriesData {
  name: string;
  alpha2Code: string;
  capital: string;
  population: number;
  latlng: number[];
  flag: string;
}

function App() {
  // const [searchedCountries, SetSearchedCountries] = useState<CountriesData[]>([]);

  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route exact path="/" component={CountrySearchForm} />
          <Route
            exact
            path={Routes.CountryList + "/:countryName"}
            component={CountryList}
          />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
